function Gensi (dom, data_in)
{
	var domWidth = $(dom).width(),
		domHeight = $(dom).height(),

        numFriends = data_in.nodes.length-1, // load in number of nodes (-1 for id==0)

		nodes = null,
		links = null,

		node = null,
		link = null,

		mode = 'add',
		selected = false,

		nodeColor = '#b5b5b5',
		internationalColor = '#9CD4D4',
        dutchColor = '#FF8C00',

        checkedAdd = false,
        checkedLink = false,
        checkedCloseness = null,
        checkedTrust = null;

        var self = this;

        var submit = $('[name ="submitGensi"]');
        submit.hide();

     var boxbar_margin = 10,
         boxbar_label_margin = 3,
         bar_target_height = 150,
         bar_target_width = ((domWidth - (boxbar_margin * 4) - 20) / 5),
         bar4_target_width = ((domWidth - (boxbar_margin * 3) - 20) / 4),
         bar5_target_width = ((domWidth - (boxbar_margin * 4) - 20) / 5),
         bar6_target_width = ((domWidth - (boxbar_margin * 5) - 20) / 6),
         bar_label_height = 25,
         boxbar_offset_x = 10,
         boxbar_offset_y = domHeight - bar_target_height - 50;

	this.init = function()
	{
		var svg = d3.select(dom).append("svg")
		.attr("width", domWidth)
		.attr("height", domHeight)
		.on("contextmenu", function() {d3.event.preventDefault()});

		force = d3.layout.force()
		.size([domWidth, domHeight])
 		.nodes(data_in.nodes)// initialize with a pre-data
// 		.links(data_in.links)
		.linkDistance(100)
		.charge(-1500)
		.on("tick", this.tick);

		nodes = force.nodes();
		links = force.links();
		node = svg.selectAll(".node");
		link = svg.selectAll(".link");

		var addBtn = $('<button type="button" class="btn btn-info">Add</button>').on ('click', () => { this.addFriend(); });
		var addChk = $('<div class="checkbox"><label><input type="checkbox" id="linkCheck" > None of my interaction partners know each other.</label>').on('click', () => { 
		    var checkBox = document.getElementById("linkCheck");
		    if (checkBox.checked == true){
                checkedLink = true; 
                $("#linksTxt").html('<i class="fa fa-check-circle" aria-hidden="true" style="color:green"></i> 2. Connections'); 
                this.restart();
            } else if (checkBox.checked == false){
                checkedLink = false; 
                $("#linksTxt").html('<i class="fa fa-exclamation-circle" aria-hidden="true" style="color:firebrick"></i> 2. Connections');
                this.restart();
            }
		  //  checkedLink = true; 
		  //  $("#linksTxt").html('<i class="fa fa-check-circle" aria-hidden="true" style="color:green"></i> 2. Connections'); 
		  //  this.restart(); 
		    });
		var dialog = $('<div id="name_input" title="Adjust the network" style="width: 400px;">\
			<div id="tab_panel">\
				<ul id="list">\
					<li><a href="#add_friends" id="addTxt"><i class="fa fa-check-circle-o" aria-hidden="true"></i> 1. Add people</a></li>\
					<li><a href="#links" id="linksTxt"><i class="fa fa-check-circle-o" aria-hidden="true"></i> 2. Connections</a></li>\
					<li><a href="#closeness" id="closenessTxt"><i class="fa fa-check-circle-o" aria-hidden="true"></i> 3. Closeness</a></li>\
					<li><a href="#trust" id="trustTxt"><i class="fa fa-check-circle-o" aria-hidden="true"></i> 4. Trust</a></li>\
					<li><a href="#submit" id="submitTxt">5. Submit</a></li>\
				</ul>\
				<div id="add_friends">\
				<i>This section is optional.</i> Please add people you usually have face-to-face interactions with. After you added a new person please indicate whether they are <font color="#FF8C00">Dutch</font> or <font color="#9CD4D4">Non-Dutch</font> by clicking on the person.<br><br>\
					<input type="text" id="friendNameID" name="friendName" placeholder="Name" size="10"> \
				</div>\
				<div id="links">\
					Please click on people who know each other to connect them.\
				</div>\
				<div id="closeness">\
					How close do you feel to these people?<br>\
					Please move all people to the best-fitting categories. The task works best if the circles do not completely overlap.\
				</div>\
				<div id="trust">\
					How much do you trust these people?<br>\
					Please move all people to the best-fitting categories. The task works best if the circles do not completely overlap.\
				</div>\
				<div id="submit">\
					Once you have completed sections 1-4 (green checkmarks), a submit button is available at the bottom of the page.\
				</div>');
		dialog.find ('#add_friends').append(addBtn);
		dialog.find ('#links').append(addChk);
		dialog.dialog ({
			open: function()
			{
				$('#tab_panel').tabs();

			},
			width: "1000px",
            maxWidth: "1000px",
            position: { my: "left top", at: "left top", of: render }
		});

		$('#friendNameID').on ('keyup', (e) =>
		{
			if (e.keyCode == 13)
			{
				this.addFriend();
			}
		});

		$('#tab_panel').tabs({
		   	activate: function (ui, event)
			{
				var tab = event.newPanel.attr ('id');
				if (tab == 'links')
				{
					d3.selectAll(".link").attr("display", "block");

				    d3.selectAll ('#labelBarCloseness').style ('display', 'none');
				    d3.selectAll ('#labelBarTrust').style ('display', 'none');
					d3.selectAll ('#fiveBar').style ('display', 'none');

					d3.selectAll(".node").attr("opacity", function(d) { if (d.index == 0) { return 1}});

					d3.selectAll(".node").classed("fixed", function(d) { d.fixed = false});

					checkedAdd = true;
                    $("#addTxt").html('<i class="fa fa-check-circle" aria-hidden="true" style="color:green"></i> 1. Add people');

					mode = 'link';
				}
				else if (tab == 'add_friends')
				{
					d3.selectAll(".link").attr("display", "block"); 

				    d3.selectAll ('#labelBarCloseness').style ('display', 'none');
				    d3.selectAll ('#labelBarTrust').style ('display', 'none');
					d3.selectAll ('#fiveBar').style ('display', 'none');

					d3.selectAll(".node").attr("opacity", function(d) { if (d.index == 0) { return 1}});

					d3.selectAll(".node").classed("fixed", function(d) { d.fixed = false});

					mode = 'add';
				}
				else if (tab == 'closeness')
				{
					d3.selectAll(".node").classed("fixed", function(d) { d.fixed = false });
					setTimeout(function() {
                        d3.selectAll(".node").classed("fixed", function(d) { d.fixed = true });
                    },1000);

				    d3.selectAll(".link").attr("display", "none");  
				    d3.selectAll ('#labelBarTrust').style ('display', 'none');

					d3.selectAll ('#labelBarCloseness').style ('display', 'block');
					d3.selectAll ('#fiveBar').style ('display', 'block');

					d3.selectAll(".node").attr("opacity", function(d) { return d.index == 0 ? .4 : 1 });

					checkedAdd = true;
                    console.log(" add ready");
                    $("#addTxt").html('<i class="fa fa-check-circle" aria-hidden="true" style="color:green"></i> 1. Add people');

					mode = 'categoryCloseness';
				}
				else if (tab == 'trust')
				{
					d3.selectAll(".node").classed("fixed", function(d) { d.fixed = false });
					setTimeout(function() {
                        d3.selectAll(".node").classed("fixed", function(d) { d.fixed = true });
                    },1000);

                    d3.selectAll(".link").attr("display", "none");
					d3.selectAll ('#labelBarCloseness').style ('display', 'none');

					d3.selectAll ('#labelBarTrust').style ('display', 'block');
					d3.selectAll ('#fiveBar').style ('display', 'block');

					d3.selectAll(".node").attr("opacity", function(d) { return d.index == 0 ? .4 : 1 });

					checkedAdd = true;
                    console.log(" add ready");
                    $("#addTxt").html('<i class="fa fa-check-circle" aria-hidden="true" style="color:green"></i> 1. Add people');

					mode = 'categoryTrust';
				}
				else if (tab == 'submit')
				{
					d3.selectAll(".link").attr("display", "block");

				    d3.selectAll ('#labelBarCloseness').style ('display', 'none');
				    d3.selectAll ('#labelBarTrust').style ('display', 'none');
					d3.selectAll ('#fiveBar').style ('display', 'none');

					d3.selectAll(".node").attr("opacity", function(d) { if (d.index == 0) { return 1}});

					d3.selectAll(".node").classed("fixed", function(d) { d.fixed = false});

					checkedAdd = true;
                    $("#addTxt").html('<i class="fa fa-check-circle" aria-hidden="true" style="color:green"></i> 1. Add people');

					mode = 'submit';
				}
			}
		});

		let friendName = $('#friendNameID');
		let createFriendBtn = $('#createFriendBtn');
		createFriendBtn.on ('click', this.addFriend );

		var fiveBar = d3.select("svg").append("g")
        .attr("id", "fiveBar")
        .style("display", "none")

     fiveBar.append("rect")
        .attr("class", "bar_target")
        .attr("id", "one")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x)
        .attr("y", boxbar_offset_y)
        .attr("width", bar_target_width)
        .attr("height", bar_target_height);

      fiveBar.append("rect")
        .attr("class", "bar_target")
        .attr("id", "two")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + bar_target_width + boxbar_margin)
        .attr("y", boxbar_offset_y)
        .attr("width", bar_target_width)
        .attr("height", bar_target_height);

      fiveBar.append("rect")
        .attr("class", "bar_target")
        .attr("id", "three")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar_target_width + boxbar_margin) * 2)
        .attr("y", boxbar_offset_y)
        .attr("width", bar_target_width)
        .attr("height", bar_target_height);

      fiveBar.append("rect")
        .attr("class", "bar_target")
        .attr("id", "four")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar_target_width + boxbar_margin) * 3)
        .attr("y", boxbar_offset_y)
        .attr("width", bar_target_width)
        .attr("height", bar_target_height);

      fiveBar.append("rect")
        .attr("class", "bar_target")
        .attr("id", "five")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar_target_width + boxbar_margin) * 4)
        .attr("y", boxbar_offset_y)
        .attr("width", bar_target_width)
        .attr("height", bar_target_height);


	var labelBar = d3.select("svg").append("g")
        .style("display", "none")
        .attr("id", "labelBarCloseness");

      labelBar.append("rect")
        .attr("class", "bar_label")
        .attr("id", "not_close_at_all")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar5_target_width + boxbar_margin) * 0)
        .attr("y", boxbar_offset_y - bar_label_height - boxbar_label_margin)
        .attr("width", bar5_target_width)
        .attr("height", bar_label_height);

      labelBar.append("text")
        .attr("class", "bar_text")
        .text("Not close at all")
        .attr("text-anchor", "middle")
        .attr("x", boxbar_offset_x + (bar_target_width / 2))
        .attr("y", boxbar_offset_y - boxbar_label_margin - 6);

      labelBar.append("rect")
        .attr("class", "bar_label")
        .attr("id", "a_little_close")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar5_target_width + boxbar_margin) * 1)
        .attr("y", boxbar_offset_y - bar_label_height - boxbar_label_margin)
        .attr("width", bar5_target_width)
        .attr("height", bar_label_height);

      labelBar.append("text")
        .attr("class", "bar_text")
        .text("A little close")
        .attr("text-anchor", "middle")
        .attr("x", boxbar_offset_x + bar_target_width + boxbar_margin + (bar_target_width / 2))
        .attr("y", boxbar_offset_y - boxbar_label_margin - 6);

      labelBar.append("rect")
          .attr("class", "bar_label")
          .attr("id", "somewhat_close")     
          .attr("rx", 4)
          .attr("ry", 4)
          .attr("x", boxbar_offset_x + (bar5_target_width + boxbar_margin) * 2)
        .attr("y", boxbar_offset_y - bar_label_height - boxbar_label_margin)
        .attr("width", bar5_target_width)
        .attr("height", bar_label_height);

      labelBar.append("text")
        .attr("class", "bar_text")
        .text("Somewhat close")
        .attr("text-anchor", "middle")
        .attr("x", boxbar_offset_x + (bar_target_width + boxbar_margin) * 2 + (bar_target_width / 2))
        .attr("y", boxbar_offset_y - boxbar_label_margin - 6);

      labelBar.append("rect")
        .attr("class", "bar_label")
        .attr("id", "very_close")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar5_target_width + boxbar_margin) * 3)
        .attr("y", boxbar_offset_y - bar_label_height - boxbar_label_margin)
        .attr("width", bar5_target_width)
        .attr("height", bar_label_height);

      labelBar.append("text")
        .attr("class", "bar_text")
        .text("Very close")
        .attr("text-anchor", "middle")
        .attr("x", boxbar_offset_x + (bar_target_width + boxbar_margin) * 3 + (bar_target_width / 2))
        .attr("y", boxbar_offset_y - boxbar_label_margin - 6);

      labelBar.append("rect")
        .attr("class", "bar_label")
        .attr("id", "extremely_close")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar5_target_width + boxbar_margin) * 4)
        .attr("y", boxbar_offset_y - bar_label_height - boxbar_label_margin)
        .attr("width", bar5_target_width)
        .attr("height", bar_label_height);

      labelBar.append("text")
        .attr("class", "bar_text")
        .text("Extremely close")
        .attr("text-anchor", "middle")
        .attr("x", boxbar_offset_x + (bar_target_width + boxbar_margin) * 4 + (bar_target_width / 2))
        .attr("y", boxbar_offset_y - boxbar_label_margin - 6);

    var labelBar = d3.select("svg").append("g")
        .style("display", "none")
        .attr("id", "labelBarTrust");

      labelBar.append("rect")
        .attr("class", "bar_label")
        .attr("id", "do_not_trust_at_all")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar5_target_width + boxbar_margin) * 0)
        .attr("y", boxbar_offset_y - bar_label_height - boxbar_label_margin)
        .attr("width", bar5_target_width)
        .attr("height", bar_label_height);

      labelBar.append("text")
        .attr("class", "bar_text")
        .text("Do not trust at all")
        .attr("text-anchor", "middle")
        .attr("x", boxbar_offset_x + (bar_target_width / 2))
        .attr("y", boxbar_offset_y - boxbar_label_margin - 6);

      labelBar.append("rect")
        .attr("class", "bar_label")
        .attr("id", "trust_a_little")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar5_target_width + boxbar_margin) * 1)
        .attr("y", boxbar_offset_y - bar_label_height - boxbar_label_margin)
        .attr("width", bar5_target_width)
        .attr("height", bar_label_height);

      labelBar.append("text")
        .attr("class", "bar_text")
        .text("Trust a little")
        .attr("text-anchor", "middle")
        .attr("x", boxbar_offset_x + bar_target_width + boxbar_margin + (bar_target_width / 2))
        .attr("y", boxbar_offset_y - boxbar_label_margin - 6);

      labelBar.append("rect")
          .attr("class", "bar_label")
          .attr("id", "somewhat_trust")     
          .attr("rx", 4)
          .attr("ry", 4)
          .attr("x", boxbar_offset_x + (bar5_target_width + boxbar_margin) * 2)
        .attr("y", boxbar_offset_y - bar_label_height - boxbar_label_margin)
        .attr("width", bar5_target_width)
        .attr("height", bar_label_height);

      labelBar.append("text")
        .attr("class", "bar_text")
        .text("Somewhat trust")
        .attr("text-anchor", "middle")
        .attr("x", boxbar_offset_x + (bar_target_width + boxbar_margin) * 2 + (bar_target_width / 2))
        .attr("y", boxbar_offset_y - boxbar_label_margin - 6);

      labelBar.append("rect")
        .attr("class", "bar_label")
        .attr("id", "mostly_trust")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar5_target_width + boxbar_margin) * 3)
        .attr("y", boxbar_offset_y - bar_label_height - boxbar_label_margin)
        .attr("width", bar5_target_width)
        .attr("height", bar_label_height);

      labelBar.append("text")
        .attr("class", "bar_text")
        .text("Mostly trust")
        .attr("text-anchor", "middle")
        .attr("x", boxbar_offset_x + (bar_target_width + boxbar_margin) * 3 + (bar_target_width / 2))
        .attr("y", boxbar_offset_y - boxbar_label_margin - 6);

      labelBar.append("rect")
        .attr("class", "bar_label")
        .attr("id", "completely_trust")     
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("x", boxbar_offset_x + (bar5_target_width + boxbar_margin) * 4)
        .attr("y", boxbar_offset_y - bar_label_height - boxbar_label_margin)
        .attr("width", bar5_target_width)
        .attr("height", bar_label_height);

      labelBar.append("text")
        .attr("class", "bar_text")
        .text("Completely trust")
        .attr("text-anchor", "middle")
        .attr("x", boxbar_offset_x + (bar_target_width + boxbar_margin) * 4 + (bar_target_width / 2))
        .attr("y", boxbar_offset_y - boxbar_label_margin - 6);
	}

	this.connectionInit = function ()
	{
		var i;
        for (i = 0; i < data_in.links.length; i++) {
          links.push (data_in.links[i]);;
        }
	}


    this.colorInit = function ()
	{
	   d3.selectAll("g.node > circle")
	   //.filter(function(d) {return d.nationality == "Dutch"})
	   .style("fill", function(d) {return d.rgbColor});

	   //ALTERNATIVE
	   //d3.selectAll("circle")
       //.style("fill", function(d) {return d.rgbColor});
	}

	this.getData = function()
    {
		return {
			nodes: nodes.map (x => ({name: x.name, nationality: x.nationality, closeness: x.closeness, id: x.id, trust: x.trust})),
			links: links.map (x => [x.source.name, x.target.name]),
			fullLinks: links,
			fullNodes: nodes
		};
	}

	this.storeFormR = function (survey_var)
	{
		$('input[name="' + survey_var + '"]').val(JSON.stringify(this.getData()));
	};

	this.addFriend = function()
	{
		if (document.getElementById("friendNameID").value != '')
		{
			var friendName = document.getElementById("friendNameID").value;
			  numFriends++;

				var node = {name: friendName, 
							id: numFriends, 
							gender:"", 
							age:0,
							rgbColor: "#b5b5b5",
							nationality:"",
							religion:"", 
							surveyTime:0,
							sawStats:false,
							edu:null, 
							freq:null,
							friendsWith:"",
							haveBlackFriends:"",
							friendsBlackFriends:"",
							knowBlackFriends:"",
							seeBlackFriends:"",
							trust:"",
							enjoy:"",
							like:"",
							interest:"",
							motivation:""}
				var n = nodes.push(node);

				links.push ({source: node, target: 0});

				document.getElementById("friendNameID").value = '';

				this.restart();
				this.storeFormR ('gensi_data');
          }
     }

     this.restart = function() {
        force.start();

        link = link.data(links);


        link.enter().insert("line", ".node")
            .attr("class", "link")
            //.on("contextmenu", removeLink);

        link.exit().remove();

        node = node.data(nodes);

        var n = node.enter().append("svg:g")
          .attr("class", "node")
          .call(force.drag);

        n.append("svg:circle")
          .attr("class", "node")
          .attr("r", 25)
          .on("click", this.nodeSelect)
          .call(force.drag);

        n.append("svg:text")
          .attr("class", "node_text")
          .attr("text-anchor", "middle")  
          .attr("dy", ".3em")
          .attr("pointer-events", "none")
          .text(function(d) { return d.name });

        n.attr("transform", function(d){return "translate("+d.x+","+d.y+")"});

        console.log("Add = "+checkedAdd+", Connection = "+checkedLink+", Close = "+checkedCloseness+ ", Trust = "+checkedTrust)
        if (checkedAdd == true && checkedLink == true && checkedCloseness == true && checkedTrust == true) {
            submit.show();
            $("#submit").text('You have completed all sections of the network, a submit button is now available at the bottom of the page.');
        } else {
            submit.hide();
            $("#submit").text('Once you have completed sections 1-4 (green checkmarks), a submit button is available at the bottom of the page.');
        };

     }

    this.tick = function() {
        link.attr("x1", function(d) { return d.source.x; })
            .attr("y1", function(d) { return d.source.y; })
            .attr("x2", function(d) { return d.target.x; })
            .attr("y2", function(d) { return d.target.y; });

        node.attr("cx", function(d) { return d.x; })
            .attr("cy", function(d) { return d.y; })
            .attr("name", function(d) { return d.name; })
            .attr("id", function(d) { return d.id; })
            .attr("race", function(d) { return d.race; })
            .attr("edu", function(d) { return d.edu; })
            .attr("freq", function(d) { return d.freq; })
            .attr("gender", function(d) { return d.gender; })
            .attr("transform", function(d){return "translate("+d.x+","+d.y+")"});
      }


     var origNames = [];
    data_in.nodes.forEach(function(d){
        origNames.push(d.name);
    });

     this.nodeSelect = function (d) {
// 		 console.log (mode);
	      // Slide 5: select female friends
	      if (mode == 'add') {
	        if ($.inArray(d.name, origNames) == -1) {
	          if (d.nationality == "Non-Dutch") {
		          d3.select(this).style("fill", dutchColor)
      		    d.nationality = "Dutch";
	          } else {
      		    d3.select(this).style("fill", internationalColor)
      		    d.nationality = "Non-Dutch";
	          }
	        }
	      }

        // Slide 7: draw links between friends that know each other 
        if (mode == 'link') {
          //var checkedLink = false;
          let targetIndex;
          let sourceIndex;


          if (selected == false) {
            targetId = d.id;
            console.log("targetId: " + targetId);
            selected = true;
          } else {
            sourceId = d.id;
            console.log("sourceid: " + sourceId);
            if (targetId != sourceId) {
              nodes.forEach(function(n) {
                if (n.id == targetId) {
                  targetIndex = n.index;
                  console.log("target: " + targetIndex);
                } else if (n.id == sourceId) {
                  sourceIndex = n.index;
                  console.log("source: " + sourceIndex);
                } 
              });
              nodes[sourceIndex].friendsWith += targetIndex.toString();
              nodes[targetIndex].friendsWith += sourceIndex.toString();

              console.log (nodes[sourceIndex]);
              console.log (links.attr);
              let exists = links.filter (x => x.source == nodes[sourceIndex] && x.target == nodes[targetIndex]);
              if (exists.length == 0)
              {
				   exists = links.filter (x => x.source == nodes[targetIndex] && x.target == nodes[sourceIndex]);
			   }

              console.log (exists);
              //console.log ('-----');

              // remove
              if (exists.length > 0)
              {
				  links.splice ( links.indexOf (exists[0]), 1);
				  checkedLink = true;
			  }
			  // add
			  else
			  {
				let e = {source: sourceIndex, target: targetIndex};
				links.push (e);
				console.log ({source: sourceIndex, target: targetIndex});
				checkedLink = true;
				$("#linksTxt").html('<i class="fa fa-check-circle" aria-hidden="true" style="color:green"></i> 2. Connections');
			  }
            }
            selected = false;
          }
          self.restart();
        }

        if (mode == 'categoryCloseness') {
          var nodeAbove = false;
          var nodeBelow = false;
          $("#closenessTxt").html('<i class="fa fa-exclamation-circle" aria-hidden="true" style="color:firebrick"></i> 3. Closeness');

          // Make sure the nodes are correctly placed in one of the boxes
          nodes.forEach(function(n) {
            if (n.index > 0) {
              if (n.y < boxbar_offset_y) {
                nodeAbove = true;
                console.log("nodeAbove: " + nodeAbove);
              } 
              else if (n.y > boxbar_offset_y + bar_target_height) {
                nodeBelow = true;
                console.log("nodeBelow: " + nodeBelow);
              }
            }
          });

          if (nodeBelow || nodeAbove) {
            console.log("not ready yet");
            checkedCloseness = false;
          } else {
            nodes.forEach(function(n) {
              if (n.index > 0) {
                if (n.x < boxbar_offset_x + bar5_target_width && n.y > boxbar_offset_y) {
                  n.closeness = "Not close at all";
                } else if (n.x < boxbar_offset_x + bar5_target_width * 2 + boxbar_margin && n.y > boxbar_offset_y) {
                  n.closeness = "A little close";
                } else if (n.x < boxbar_offset_x + (bar5_target_width + boxbar_margin) * 2 + bar5_target_width && n.y > boxbar_offset_y) {
                  n.closeness = "Somewhat close";
                } else if (n.x < boxbar_offset_x + (bar5_target_width + boxbar_margin) * 3 + bar5_target_width && n.y > boxbar_offset_y) {
                  n.closeness = "Very close";
                } else if (n.y > boxbar_offset_y) {
                  n.closeness = "Extremely close";
                } 
              }
            }); 

            checkedCloseness = true;
            console.log("closeness ready");
            $("#closenessTxt").html('<i class="fa fa-check-circle" aria-hidden="true" style="color:green"></i> 3. Closeness');

            }
        self.restart();
        }

        if (mode == 'categoryTrust') {
          var nodeAbove = false;
          var nodeBelow = false;
          $("#trustTxt").html('<i class="fa fa-exclamation-circle" aria-hidden="true" style="color:firebrick"></i> 4. Trust');

          // Make sure the nodes are correctly placed in one of the boxes
          nodes.forEach(function(n) {
            if (n.index > 0) {
              if (n.y < boxbar_offset_y) {
                nodeAbove = true;
                console.log("nodeAbove: " + nodeAbove);
              } 
              else if (n.y > boxbar_offset_y + bar_target_height) {
                nodeBelow = true;
                console.log("nodeBelow: " + nodeBelow);
              }
            }
          });

          if (nodeBelow || nodeAbove) {
            console.log("not ready yet");
            checkedTrust = false;
          } else {
            nodes.forEach(function(n) {
              if (n.index > 0) {
                if (n.x < boxbar_offset_x + bar5_target_width && n.y > boxbar_offset_y) {
                  n.trust = "Do not trust at all";
                } else if (n.x < boxbar_offset_x + bar5_target_width * 2 + boxbar_margin && n.y > boxbar_offset_y) {
                  n.trust = "Trust a little";
                } else if (n.x < boxbar_offset_x + (bar5_target_width + boxbar_margin) * 2 + bar5_target_width && n.y > boxbar_offset_y) {
                  n.trust = "Somewhat trust";
                } else if (n.x < boxbar_offset_x + (bar5_target_width + boxbar_margin) * 3 + bar5_target_width && n.y > boxbar_offset_y) {
                  n.trust = "Mostly trust";
                } else if (n.y > boxbar_offset_y) {
                  n.trust = "Completely trust";
                } 
              }
            }); 

            checkedTrust = true;
            console.log("trust ready");
            $("#trustTxt").html('<i class="fa fa-check-circle" aria-hidden="true" style="color:green"></i> 4. Trust');

            }
        self.restart();
        }

        self.storeFormR ('gensi_data');
      }

    this.init();
    this.restart();
    this.connectionInit();
    this.colorInit();
    this.restart();
    this.storeFormR ('gensi_data');
}


